using ii.InfinityEngine.Binary;
using ii.InfinityEngine.Files;
using System;
using System.Collections.Generic;
using System.Drawing;
using System.Drawing.Imaging;
using System.IO;
using System.Runtime.InteropServices;

namespace ii.InfinityEngine.Readers
{
    public class PltFileBinaryReader : IPltFileReader
    {

        private const string DefaultPalette64 = @"";

        public PltFile Read(string filename, Bitmap palette)
        {
            if (palette == null)
            {
                var bytes = Convert.FromBase64String(DefaultPalette64);
                palette = Bitmap.FromStream(new MemoryStream(bytes)) as Bitmap;
            }

            using var fs = new FileStream(filename, FileMode.Open, FileAccess.Read);
            var f = Read(fs, palette);
            f.Filename = Path.GetFileName(filename);
            return f;
        }

        public PltFile Read(Stream s, Bitmap palette)
        {
            if (palette == null)
            {
                var bytes = Convert.FromBase64String(DefaultPalette64);
                palette = Bitmap.FromStream(new MemoryStream(bytes)) as Bitmap;
            }

            using var br = new BinaryReader(s);
            var pltFile = ParseFile(br, palette);
            br.BaseStream.Seek(0, SeekOrigin.Begin);
            pltFile.OriginalFile = ParseFile(br, palette);
            return pltFile;
        }

        private PltFile ParseFile(BinaryReader br, Bitmap palette)
        {
            var header = (PltHeaderBinary)Common.ReadStruct(br, typeof(PltHeaderBinary));

            List<PltBodyBinary> pixels = [];

            for (int i = 0; i < header.Width * header.Height; i++)
            {
                var pixel = (PltBodyBinary)Common.ReadStruct(br, typeof(PltBodyBinary));
                pixels.Add(pixel);
            }

            var bitmap = new Bitmap(header.Width, header.Height);
            var bData = bitmap.LockBits(new Rectangle(0, 0, header.Width, header.Height), ImageLockMode.ReadWrite, bitmap.PixelFormat);
            var size = bData.Stride * bData.Height;
            var xdata = new byte[size];
            Marshal.Copy(bData.Scan0, xdata, 0, size);

            if (palette != null)
            {
                var paletteData = palette.LockBits(new Rectangle(0, 0, palette.Width, palette.Height), ImageLockMode.ReadWrite, palette.PixelFormat);
                var paletteSize = paletteData.Stride * paletteData.Height;
                var paletteDataArray = new byte[paletteSize];
                Marshal.Copy(paletteData.Scan0, paletteDataArray, 0, paletteSize);

                var cnt = xdata.Length - 1;
                for (int y = 0; y < header.Height; y++)
                {
                    for (int x = 0; x < header.Width; x++)
                    {
                        var pixel = pixels[(y * header.Width) + x];
                        var colour1 = paletteDataArray[(pixel.Row * palette.Width) + (pixel.Column * 3) + 0];
                        var colour2 = paletteDataArray[(pixel.Row * palette.Width) + (pixel.Column * 3) + 1];
                        var colour3 = paletteDataArray[(pixel.Row * palette.Width) + (pixel.Column * 3) + 2];

                        // Build up the image backwards, as bitmaps are stored bottom to top
                        xdata[cnt - 3] = colour1;
                        xdata[cnt - 2] = colour2;
                        xdata[cnt - 1] = colour3;
                        xdata[cnt - 0] = 0; // Alpha
                        cnt -= 4;
                    }
                }
                palette.UnlockBits(paletteData);
            }
            else
            {
                var cnt = xdata.Length - 1;
                for (int y = 0; y < header.Height; y++)
                {
                    for (int x = 0; x < header.Width; x++)
                    {
                        var pixel = pixels[(y * header.Width) + x];

                        // Build up the image backwards, as bitmaps are stored bottom to top
                        xdata[cnt - 3] = pixel.Column;
                        xdata[cnt - 2] = pixel.Column;
                        xdata[cnt - 1] = pixel.Column;
                        xdata[cnt - 0] = 0; // Alpha
                        cnt -= 4;
                    }
                }
            }

            Marshal.Copy(xdata, 0, bData.Scan0, xdata.Length);
            bitmap.UnlockBits(bData);

            // In the code above we're accounting for bottom-top, but not right-left. As a temp hack we'll flip here instead.
            bitmap.RotateFlip(RotateFlipType.RotateNoneFlipX);

            PltFile pltFile = new PltFile();
            pltFile.Image = bitmap;
            pltFile.Checksum = HashGenerator.GenerateKey(pltFile);
            return pltFile;
        }
    }
}